script: |
  super -f text -I q10081.spq | sort > q10081.out

inputs:
  - name: q10081.spq
    data: |
      SELECT ALL COUNT ( * ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 + 31 * - + col2 BETWEEN 71 * - 2 + + 14 AND + 95 + + 68;
  - name: tab1

outputs:
  - name: q10081.out
    data: |
      3
